import React from 'react';
import 'App.css';
import { Routes, Route, Outlet, Link } from "react-router-dom";
const Sidebar = React.lazy(() => import('component/Sidebar'));
const Login = React.lazy(() => import('container/Login'));

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path={"login"} index element={<Login />} />
        <Route path="/" element={<Layout />}>

          <Route
            path="about"
            element={
              <React.Suspense fallback={<>...</>}>
                <Login />
              </React.Suspense>
            }
          />
        </Route>
      </Routes>
    </div>
  );
}

function Layout() {
  return (
    <div>
      <Sidebar/>
      <main>
        <Outlet />
      </main>
    </div>
  );
}

export default App;
